  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"August 20, 2007    Mr. Daniel T. Buckley
    \ Federal Election Commission  Washington, D. C., 20463    Re:\tJuly Monthly Report
    (June 1 - June 30, 2007)    Dear Mr. Buckley:  Pursuant to your letter dated July
    27, 2007, we are filing this amended report.  Beginning cash balance for this
    report is the same as the ending cash balance reported on the amended May Report
    filed on August 6, 2007 and lines 6c, 7, 11aii, 11aiii, 11d, 19, 20 21ai, 21aii,
    21b, 30b, 30c, 31 and 32 have been corrected.  With respect to the Partys expenditures
    for payroll, payroll taxes, and other payroll or employee benefit-related expenses,
    the Party adheres to the regulation cited in your letter and also follows the
    Commissions revision of the rules as adopted on December 1, 2005. Specifically,
    as you outlined in your letter, the Party pays for these costs with 100% federal
    funds when the employee spends more than 25 percent of his or her time in a month
    on federal election activity (FEA) or activity in connection with a federal election.
    These expenditures are reported on Schedule B for Line 30b.  Alternatively, when
    an employee does not meet the 25 percent threshold, the Party allocates these
    costs as an overhead/administrative expense, and reports these disbursements on
    a Schedule H4 for Line 21a.   Schedule B Line 21(b) reports reimbursement payments
    that do not exceed $200 in the aggregate nor do the vendors exceed $200 in the
    aggregate.   Also included, in reconciling allocated expenditures, two expenditures
    previously reported on Line 21(b) were reclassified and reported on Schedule H4.
    \ Finally, a fundraising event was set up on H2 and corresponding allocated expense
    was reported.    Respectfully submitted, Wayne Tucker, Treasurer\""
